30. The method of embodiment 27, further comprising:





(a) crossing a rice plant grown from the resultant rice seed and a rice plant of a different line to produce a seed of a progeny rice plant of a subsequent generation;

(b) growing the seed of a progeny rice plant of a subsequent generation of step produced in step (a) and crossing the resultant progeny rice plant of a subsequent generation with itself or a rice plant of a different line to produce seed of a progeny rice plant of a further subsequent generation;

(c) growing the seed of the progeny rice plant of a further subsequent generation produced in step (b); and

(d) interbreeding the progeny rice plant of a further subsequent generation to produce a resultant inbred rice plant.

34. A method of introducing one or more desired traits into inbred rice line DG263L, wherein the method comprises:





(a) crossing a rice plant of inbred rice line DG263L with a rice plant of another rice line that comprises the one or more desired traits to produce progeny plants, wherein a representative sample of seed of the inbred rice line DG263L is being stored and maintained by Loveland Products, Inc. at LPI Rice Breeding Station in El Campo, Tex., with a representative sample of seed of DG263L to be deposited with the American Type Culture Collection (ATCC) in accordance with 37 CFR §§ 1.801 to 1.809;

(b) selecting one or more progeny plants that have the one or more desired traits to produce selected progeny plants;

(c) backcrossing the selected progeny plants with rice plants of inbred rice line DG263L;

(d) selecting for backcross progeny plants that have the one or more desired traits; and

(e) repeating steps (c) and (d) one or more times in succession to produce selected second or higher backcross progeny plants that comprise the one or more desired traits and essentially all of they physiological and morphological characteristics of inbred rice line DG263L.

claim.claim-text:
12. A method of introducing one or more desired traits into inbred rice line DG263L, wherein the method comprises:
(a) crossing a rice plant of inbred rice line DG263L with a rice plant of another rice line that comprises the one or more desired traits to produce progeny plants, wherein a representative sample of seed of the inbred rice line DG263L is being stored and maintained by Loveland Products, Inc. at LPI Rice Breeding Station in El Campo, Tex., with a representative sample of seed of DG263L to be deposited with the American Type Culture Collection (ATCC) in accordance with 37 CFR §§ 1.801 to 1.809;
(b) selecting one or more progeny plants that have the one or more desired traits to produce selected progeny plants;
(c) backcrossing the selected progeny plants with rice plants of inbred rice line DG263L;
(d) selecting for backcross progeny plants that have the one or more desired traits; and
(e) repeating steps (c) and (d) one or more times in succession to produce selected second or higher backcross progeny plants that comprise the one or more desired traits and essentially all of they physiological and morphological characteristics of inbred rice line DG263L.
